import React from "react";
import { Handle } from "reactflow";

const CustomNode = ({ data }) => {
  const handleDropdownChange = (e) => {
    data.onDropdownChange(e.target.value);
  };

  const handleNumberChange = (e) => {
    if (data.onNumberChange) {
      data.onNumberChange(e.target.value);
    }
  };

  const handleStringChange = (field) => (e) => {
    if (data.onStringChange) {
      data.onStringChange(field, e.target.value);
    }
  };

  const handleFileChange = (e) => {
    if (data.onFileChange) {
      data.onFileChange(e.target.files[0]);
    }
  };

  const renderNodeContent = () => {
    switch (data.label.split(" ")[0]) {
      case "Dataset":
        return (
          <>
            <div>{data.label}</div>
            <input
              type="text"
              value={data.url}
              onChange={handleStringChange("url")}
              placeholder="Enter URL"
            />
            <button onClick={data.onCredChange}>Enter Credentials</button>
          </>
        );
      case "Upload":
        return (
          <>
            <div>{data.label}</div>
            <input type="file" onChange={handleFileChange} />
          </>
        );
      case "Preprocess":
        return (
          <>
            <div>{data.label}</div>
            <input
              type="text"
              value={data.prompt}
              onChange={handleStringChange("prompt")}
              placeholder="Enter Prompt"
            />
          </>
        );
      case "Train":
        return (
          <>
            <div>{data.label}</div>
            <input
              type="number"
              value={data.temperature}
              onChange={handleNumberChange}
              placeholder="Enter Temperature"
            />
            <button onClick={data.onCredChange}>Enter Credentials</button>
          </>
        );
      case "Test":
        return (
          <>
            <div>{data.label}</div>
            <input
              type="text"
              value={data.input}
              onChange={handleStringChange("input")}
              placeholder="Enter Input"
            />
            <input
              type="text"
              value={data.output}
              onChange={handleStringChange("output")}
              placeholder="Enter Output"
            />
          </>
        );
      case "Deploy":
        return (
          <>
            <div>{data.label}</div>
            <select
              value={data.typeValue}
              onChange={(e) => (data.typeValue = e.target.value)}
            >
              <option value="">Select Type...</option>
              <option value="Batch">Batch</option>
              <option value="RTI">RTI</option>
            </select>
          </>
        );
      default:
        return <div>{data.label}</div>;
    }
  };

  return (
    <div style={{ padding: 10, border: "1px solid #ddd", borderRadius: 4 }}>
      {renderNodeContent()}
      <Handle type="source" position="right" />
      <Handle type="target" position="left" />
    </div>
  );
};

export default CustomNode;
